    | (Up, '.') -> traverse_beam beam grid (new_rownum - 1, new_colnum)
    | (Up, '|') -> traverse_beam beam grid (new_rownum - 1, new_colnum)
    | (Down, '.') -> traverse_beam beam grid (new_rownum + 1, new_colnum)
    | (Down, '|') -> traverse_beam beam grid (new_rownum + 1, new_colnum)
    | (Left, '\\') -> traverse_beam { beam with direction = Up } grid (new_rownum - 1, new_colnum)
    | (Right, '\\') -> traverse_beam { beam with direction = Down } grid (new_rownum + 1, new_colnum)
    | (Up, '\\') -> traverse_beam { beam with direction = Left } grid (new_rownum, new_colnum - 1)
    | (Down, '\\') -> traverse_beam { beam with direction = Right } grid (new_rownum, new_colnum + 1)
    | (Left, '/') -> traverse_beam { beam with direction = Down } grid (new_rownum + 1, new_colnum)
    | (Right, '/') -> traverse_beam { beam with direction = Up } grid (new_rownum - 1, new_colnum)
    | (Up, '/') -> traverse_beam { beam with direction = Right } grid (new_rownum, new_colnum + 1)
    | (Down, '/') -> traverse_beam { beam with direction = Left } grid (new_rownum, new_colnum - 1)
    | (Up, '-') -> PointSet.union (traverse_beam { beam with direction = Left } grid (new_rownum, new_colnum - 1)) (traverse_beam { beam with direction = Right } grid (new_rownum, new_colnum + 1))
    | (Down, '-') -> PointSet.union (traverse_beam { beam with direction = Left } grid (new_rownum, new_colnum - 1)) (traverse_beam { beam with direction = Right } grid (new_rownum, new_colnum + 1))
    | (Left, '|') -> PointSet.union (traverse_beam { beam with direction = Up } grid (new_rownum - 1, new_colnum)) (traverse_beam { beam with direction = Down } grid (new_rownum + 1, new_colnum))
    | (Right, '|') -> PointSet.union (traverse_beam { beam with direction = Up } grid (new_rownum - 1, new_colnum)) (traverse_beam { beam with direction = Down } grid (new_rownum + 1, new_colnum))
    | _ -> failwith "wrong case!")

let () =
  traverse_beam { direction = Right ; traversed_set = PointSet.empty } grid (0, 0)
  |> PointSet.cardinal |> string_of_int |> print_endline
